import React from "react";
import avatarDefault from "../../../../../component/Layout/assets/avatar-user.png";
import Avatar from "@mui/material/Avatar";

export default function TeacherListItem({ teacher }) {
  const avatarStyles = {
    m: 1,
    border: 2,
    borderColor: "#808080",
  };
  return (
    <>
      <li className="TeacherListItem">
        <Avatar
          src={teacher.picture || avatarDefault}
          alt={teacher.username}
          sx={{
            ...avatarStyles,
          }}
        />
        <div className="UserListItemName">{teacher.username}</div>
      </li>
    </>
  );
}
